import ListItem from "@material-ui/core/ListItem";

export default class SeriesItem extends React.Component{
  render() {
    return(
      <ListItem>
        <p style={{padding:0, margin:'5px 10px 5px 10px'}}>{this.props.series.seriesNumber}</p>
      </ListItem>
    );
  }
}
